def solve(val):
    l = map(int, list(""))#val.split(' ')[1]))
    f = s = 0
    for i, v in enumerate(l):
        if i > s:
            f = max(i-s,f)
        s = s + v
    return f

if __name__ == "__main__":
    cases = input()
    for case in xrange(1, cases+1):
        val = raw_input()
        print("Case #%i: %s" % (case, solve(val)))